window.bookSummaryJSON = "<p>Aubrey St. James is in trouble. She's locked in a cell at a government black site. She doesn't know where that site is or how the hell she got there. But she knows that it has something to do with the stranger she rescued from the river. Someone - or some<i>thing</i> - called Johnny.&nbsp;</p> <p>Saul Tarson knows that the thing he's locked up is dangerous, because it left a trail of six dead cops in its wake, all killed in a way that defies explanation. It is Saul's sworn duty to get to the truth about Johnny before more people die - a lot more.&nbsp;</p> <p>All Johnny wants is to return home. But he has a mission to fulfill first. And what he does in the next 20 hours will either save mankind - or bring it to its knees.&nbsp;</p> <p><i>Johnny </i>is the new breakneck science fiction thriller by Audible listener favorite D. J. Molles, <i>New York Times</i> best-selling author of The Remaining series.&nbsp;</p> <p><i>Narrated by Marc Vietor with additional voices by Scott Aiello, Lauren Fortgang, Amanda Ronconi, Therese Plummer, and Josh Hurley.</i></p>"; 
